import React from 'react'

export const SPHistory: React.FC = () => {
    return (
        <div>
            <h1 style={{
                display: 'flex',
                left: "500px",
                top: "-450px",
                position: "relative",
                fontFamily: "Figma Hand",
                color: "#ccc",
                fontSize: "21px",
                lineHeight: "150%",
                textAlign: "justify",
                fontStyle: "normal",
                fontWeight: 400,
                // zIndex: 66,
            }}>History</h1>
            <div
                style={{
                    backgroundColor: "#ccc",
                    position: "relative",
                    width: "250px",
                    height: "400px",
                    left: "500px",
                    top: "-400px",
                    display: "flex",
                    flexDirection: "column",
                    // justifyContent: "center", 
                    alignItems: "center"
                }}

            >

            </div>
        </div>
    )
}
